import React from "react";

const Main = () => {
    return (
        <main style={{ padding: "1rem", textAlign: "center" }}>
            <h2>Pagrindinis turinys</h2>
            <p>Čia bus svetainės pagrindinis tekstas.</p>
        </main>
    );
};

export default Main;
